import React, { Component } from 'react';
import axios from "axios";
import './App.css';
import Header from "./component/header";
import uuid from "uuid";
import {BrowserRouter as Router,Route} from "react-router-dom";
import learn from "./component/pages/learn";
import Contact from "./component/pages/contact";
import { Container, Row , Col } from "reactstrap";
import {Jumbotron} from "reactstrap";




class App extends Component {




  render(){
    return(
      <Router>
          <div className="App">
          <header className="App-header">
            <Route exact path="/" render={props=>(
              <React.Fragment>
                <Header />
                <Container className='arabic  Jumbotron'>
                  <h1>مدرستي</h1>
                  <p>  موقع لتعليم  المراحل الدراسية الابتدائية والاعداديه 
للغة العربية بكل  فروعها 
مثل: القراءة , النصوص , والنحو</p>
                </Container>

              </React.Fragment>
            )}></Route>
            <Route path="/learn" component={learn}></Route>
            <Route path="/contact" component={Contact}></Route>

          </header>
         </div>
     </Router>

    );
  }
}

export default App;
